import React from 'react'

function Overlay({children}) {
  return (
    <div
    style={{
      position: "fixed",
      top: 0,
      left: 0,
      right: 0,
      bottom: 0,
      backgroundColor: "rgba(0, 0, 0, 0.5)",
      zIndex: 1000,
    }}
  >
    {children}
  </div>
  )
}

export default Overlay
